import React from "react";
import './navbar.css';
const Navbar = () => {

    return (
        <div>
            <div>
                <h2>
                    Mohan Kumar

                </h2>
            </div>

            <ul className="order">
                <li>About</li>
                <li>Projects</li>
                <li>Skills</li>
                <li>Contacts</li>
            </ul>

        </div>

    )
};

export default Navbar;
